INSERT INTO `sw_question` VALUES ('45738', '2', '<p>3、对外电线路防护的基本措施可以是（&nbsp;）。</p>', '', '45735', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45739', '3', '<p>4、由于高压线路的四周空间存在强电场，导致四周的导体成为带电体，因此规范规定在高压排挤线路下方作业应保持一定的安全间隔，防止发生触电事故。</p>', '', '45735', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45740', '6', '<p>案例20、7月14日，民工代某等5人进行某工地地下室外墙防水涂料涂刷作业，其中1人在地面上拌、送料，其余4人下到基坑作业。到下午3时许，在基坑下约8m深处作业的民工突然晕倒跌落坑底（当时基坑底部有深约0.7m的积水），在地面上作业的民工发现后立即喊叫救人。在基坑下约4m处作业的另外3人见状急忙去抢救，结果也相断晕倒并跌落坑底积水中。周围人员听到呼救声，迅速赶来救人，在抢救过程中，营救人员也出现胸闷、头晕、意识模糊等症状。先后有14人被送往医院救治，其中2人在现场经医生确认死亡，2人经医院抢救无效死亡。经事后调查，涂刷作业使用的防水涂料中含有严重超标的苯系物质。</p>', '', '0', '12', 'A类（企业负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45741', '1', '<p>1、在建筑施工中，油漆、环氧树脂、冷沥青、塑料以及喷漆、粘接、机件的浸洗等，均用苯作为有机溶剂、稀释剂和清洗剂。有些粘接剂含苯、甲苯或丙酮的浓度高，容易发生苯的（&nbsp;）。</p>', '', '45740', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45742', '1', '<p>2、本起事故发生的原因，除了防水涂料中苯超标外，主要是（&nbsp;）。</p>', '', '45740', null, null, '1', '0', '0');
