INSERT INTO `sw_question` VALUES ('45750', '6', '<p>案例22、某冷库内装修工地，照明用碘钨灯直接用木棍连接放在装修好的墙边，夜里无人施工，碘钨灯烤着墙边的装修材料，引起大火，损失40余万元。</p>', '', '0', '12', 'A类（企业负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45751', '1', '<p>1、聚光灯及碘钨灯等高热灯具与易燃易爆物的防护距离不宜小于（&nbsp;），且不得直接照射易燃物。</p>', '', '45750', null, null, '1', '0', '0');
