INSERT INTO `sw_question` VALUES ('45755', '6', '<p>案例1、某小区十号楼地下室有一电气设备，该设备一次电源线长度为10．5m；接头处没有用橡皮包布包扎，绝缘处磨损，电源线裸露；安装在该设备上的漏电开关内的拉杆脱落，漏电开关失灵。某工程公司在该地下室施工中，付某等3名抹灰工将该电气设备移至新操作点，移动过程中付某触电死亡。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
