INSERT INTO `sw_question` VALUES ('45780', '6', '<p>案例4、焊工贾某、王某在市职业大学教学楼工地，焊接一个(4．5×2×I．5)m&lt;sup&gt;3&lt;/sup&gt;的膨胀水箱。两人完成了4／5的工作量下班后，为了赶工程进度，工地负责人又安排了油漆工加班 施工，要求将焊好的部分刷上防锈漆。因箱顶离屋顶仅有50cm间隙，通风不良，到第二天油漆还未干。而焊工上班后，虽了解到水箱上油漆未干，但因不愿误工，由贾某钻进水箱内侧扶焊，王某站在外面焊接，刚一打火“轰’’的一声，水箱上的油漆全部燃烧起来。顿时，贾某被火焰吞噬，在王某的帮助下，才爬出水箱逃命。但两人均已被烧伤。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
