INSERT INTO `sw_question` VALUES ('45786', '1', '<p>1、若原北市建筑机械租赁公司的此种进口挖掘机确实性能良好，但缺少产品合格证，下列关于该挖掘机能否对外出租的说法正确的是（&nbsp;）。</p>', '', '45785', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45787', '1', '<p>2、因为工期紧迫，东平建筑公司需要立即使用此挖掘机，在这种情况下下列关于原北市建筑机械租赁公司是否需要对出租的机械设备和施工机具及配件的安全性能进行检测，并在签订租赁协议时，出具检测合格证明的说法正确的是（&nbsp;）。</p>', '', '45785', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45788', '2', '<p>3、根据《建筑起重机械安全监督管理规定》,出租单位在建筑起重机械首次出租前，自购建筑起重机械的使用单位在建筑起重机械首次安装前，应当持建筑起重机械（&nbsp;）到本单位工商注册所在地县级以上地方人民政府建设主管部门办理备案。</p>', '', '45785', null, null, '1', '0', '0');
