INSERT INTO `sw_question` VALUES ('45859', '6', '<p>案例13、6月20日上午，电工班组长陈某安排电工刘某、普工王某移装某办公楼项目二楼西边吊顶内疏散指示灯。10时左右，2人到达作业点下方的走廊处，为便于作业，王某下楼去拿手提式应急灯。当王某回到作业点时，发现刘某因触电而仰躺在吊顶内，后经送医院抢救无效死亡。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45860', '1', '<p>1、开关箱与其供电的固定式用电设备的水平距离不宜超过（&nbsp;）。</p>', '', '45859', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45861', '1', '<p>2、施工现场用电工程的基本供配电系统应按（&nbsp;）设置。</p>', '', '45859', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45862', '2', '<p>3、施工现场需要编制用电组织设计的基准条件是（&nbsp;）。</p>', '', '45859', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45863', '3', '<p>4、在TN-S接地、接零保护系统中，N线和PE线均有可能带电。</p>', '', '45859', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45869', '6', '<p>案例14、7月14日，民工代某等5人进行某工地地下室外墙防水涂料涂刷作业，其中1人在地面上拌、送料，其余4人下到基坑作业。到下午3时许，在基坑下约8m深处作业的民工突然晕倒跌落坑底（当时基坑底部有深约0.7m的积水），在地面上作业的民工发现后立即喊叫救人。在基坑下约4m处作业的另外3人见状急忙去抢救，结果也相断晕倒并跌落坑底积水中。周围人员听到呼救声，迅速赶来救人，在抢救过程中，营救人员也出现胸闷、头晕、意识模糊等症状。先后有14人被送往医院救治，其中2人在现场经医生确认死亡，2人经医院抢救无效死亡。经事后调查，涂刷作业使用的防水涂料中含有严重超标的苯系物质。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45870', '1', '<p>1、在建筑施工中，油漆、环氧树脂、冷沥青、塑料以及喷漆、粘接、机件的浸洗等，均用苯作为有机溶剂、稀释剂和清洗剂。有些粘接剂含苯、甲苯或丙酮的浓度高，容易发生苯的（&nbsp;）。</p>', '', '45869', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45871', '1', '<p>2、本起事故发生的原因，除了防水涂料中苯超标外，主要是（&nbsp;）。</p>', '', '45869', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45872', '2', '<p>3、在施工过程中，有毒物质进入人体主要是经（&nbsp;）进入。</p>', '', '45869', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45873', '3', '<p>4、本起事故的直接原因是工地地下室外墙采用防水涂料。</p>', '', '45869', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45879', '6', '<p>案例15、某医院工程北配楼正在进行装修施工，电焊工张某在地上一层焊接水暖支架时，焊渣跌落至地下一层，引燃了堆放在地下一层的聚苯乙烯保温材料，从而引发大火。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45880', '1', '<p>1、我国消防工作的方针是（&nbsp;）。</p>', '', '45879', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45881', '1', '<p>2、施工现场内贮存易燃易爆危险品的仓库、库区，属于（&nbsp;）动火区域。</p>', '', '45879', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45882', '2', '<p>3、在施工现场禁火区域内动火，作业前必须申请办理动火证，动火证必须注明（&nbsp;）。</p>', '', '45879', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45883', '3', '<p>4、电焊工张某违规操作是引起本起事故的主要原因。</p>', '', '45879', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45889', '6', '<p>案例16、某建筑公司购置1台由某塔机生产厂生产的QTC25A塔式起重机，该塔机厂雇用李某进行首次安装。按照塔机安装的程序，塔身、塔帽、配重臂安装完毕后，着手安装起重臂(该塔机是自装式水平臂塔机)。起重臂在安装时对吊点位置、吊索的拴系方式、重心所处位置均有严格的技术要求。按照要求应设置六倍率吊索。李某等人设置了2个吊点，使用4根钢丝绳，在吊索未拴牢的情况下，将起重臂拉起，在安装拉杆时，吊点处的钢丝绳在冲击力的作用下，将起重臂两根侧向斜腹杆拉断后，向起重臂根部水平方向移动约450mm。起重臂瞬间下沉，造成钢丝绳断裂，起重臂以铰接点为轴心坠落，在起重臂上的五名操作工人随之坠落，造成4人死亡，1人受伤。经事故调查，该塔机无技术图纸，无生产工艺，无产品检验报告，作业人员未系安全带，无证作业。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45890', '1', '<p>1、塔式起重机的主参数为（&nbsp;）。</p>', '', '45889', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45891', '1', '<p>2、下列不属于塔式起重机金属结构的部分为（&nbsp;）。</p>', '', '45889', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45892', '2', '<p>3、塔式起重机按变幅方式分可分为（&nbsp;）。</p>', '', '45889', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45893', '3', '<p>4、该塔机生产厂违法雇用无安装资质的安装单位。</p>', '', '45889', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45894', '6', '<p>案例17、某工程的1号物料提升机吊笼停在2层，女工唐某进行卸料作业，操作人员临时离开。这时另一班组喊叫要求提升相邻的2号提升机，经过此地的工人胡某却开动了正在卸料的1号提升机；唐某正跨于吊笼与平台之间，上升的提升机把唐某掀翻，从二层井架平台坠落到井架底，头部撞在井架立杆上，抢救多日后，因颅内出血过重死亡。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45895', '1', '<p>1、物料提升机的吊笼装载额定载重量，悬挂或运行中发生断绳时，断绳保护装置必须可靠地把吊笼刹制在导轨上，最大制动滑落距离应不大于（&nbsp;）m。</p>', '', '45894', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45896', '1', '<p>2、当物料提升机吊笼内载荷达到额定载重量的（&nbsp;）%时，应发出报警信号。</p>', '', '45894', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45897', '2', '<p>3、物料提升机组装后应进行验收，并进行（ ）试验。</p>', '', '45894', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45898', '3', '<p>4、当有人在高处提升机吊笼处作业时，提升机操作人员擅自离岗。</p>', '', '45894', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45904', '6', '<p>案例18、某公寓楼工程发生了一起施工升降机吊笼冒顶坠落事故，造成吊笼内的3名员工死亡。该工程由裙体相连的A.B.C三幢32层高层公寓楼组成，施工总承包单位某建筑公司将该工程的部分装饰工程分包给某装饰公司。事故发生时，工程外墙装修即将结束，内装修进入修补阶段。A楼的施工升降机已拆卸至1 3层高度。发生事故的施工升降机位于A楼，由某设备租赁公司提供并负责日常维修检查工作，总承包单位工程项目部使用并配备了电梯司机。事故发生当日6时20分左右，某装饰公司员工鲍某等3人在电梯司机尚未上班到岗的情况下，擅自驾乘A楼施工升降机右笼前往7层，在上升过程中，由于超高极限开关未起作用，上行停车操作失控，发生吊笼冒顶，酿成事故。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45905', '1', '<p>1、施工升降机提升吊笼的钢丝绳的安全系数不得小于（&nbsp;）。</p>', '', '45904', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45906', '1', '<p>2、施工升降机提升吊笼的钢丝绳的直径不得小于（&nbsp;）mm。</p>', '', '45904', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45907', '2', '<p>3、下列属于施工升降机的安全保护装置的是（&nbsp;）。</p>', '', '45904', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45908', '3', '<p>4、鲍某等3人非电梯司机，无证且擅自操作施工升降机，对事故应负直接责任。</p>', '', '45904', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45914', '6', '<p>案例19、一高层住宅工程，正在装修，外脚手架已经拆到了五层楼板处，三个班组的分工为一组贴面砖，二组负责剪断脚手架的连墙件，三组拆除脚手架，当五层面砖刚完成一半时，二组已经将15m高的脚手架连墙件全部拆除，当一组拟转移到下层作业时，脚手架向外倒塌，架上人员全部坠落。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45915', '1', '<p>1、扣件式脚手架规范规定，每根钢管的重量不应超过（&nbsp;）kg。</p>', '', '45914', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45916', '1', '<p>2、当脚手架的扣件夹紧钢管时，开口处的最小距离应不小于（&nbsp;）mm。</p>', '', '45914', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45917', '2', '<p>3、下列属于扣件式脚手架上的永久荷载的是（&nbsp;）。</p>', '', '45914', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45918', '3', '<p>4、拆除脚手架前，没有编制拆除方案，只在现场临时作了分工。</p>', '', '45914', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45924', '6', '<p>案例20、某工地在3层楼施工，工人在搬运砖块，由于该作业层未满铺脚手架，而只有少数脚手板，并且有的接头处无固定，工人王某在搬了三次砖块后，一脚踏在一块未固定的探头板上，立时倾翻，王某掉下，造成大腿骨骨折。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45925', '1', '<p>1、扣件活动部位应能灵活转动，旋转扣件的两旋转面间隙应小于（&nbsp;）mm。</p>', '', '45924', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45926', '1', '<p>2、脚手架架高超过（&nbsp;）m时，连墙件应采取抗上升翻流作用的连墙措施。</p>', '', '45924', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45927', '2', '<p>3、与一般建筑钢结构相比，下列关于扣件式脚手架的结构特点叙述正确的是（&nbsp;）。</p>', '', '45924', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45928', '3', '<p>4、作业层跳板下应搭设大眼安全网。</p>', '', '45924', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45929', '6', '<p>案例21、某工地没按有关夏季施工的要求，把职工宿舍建在山沟低洼处，一场暴风雨过后，突然来的山洪将宿舍及15名工人一起冲跑，造成10人死亡。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45930', '1', '<p>1、降水强度的划分按照降水强度的大小分为（&nbsp;）个等级。</p>', '', '45929', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45931', '1', '<p>2、在做雨期施工的准备工作时，临时道路应起拱千分之（&nbsp;）。</p>', '', '45929', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45932', '2', '<p>3、下列关于土方与地基基础工程的雨期施工应采取的措施叙述正确的是（&nbsp;）。</p>', '', '45929', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45933', '3', '<p>4、雨季应有防洪水措施。</p>', '', '45929', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45939', '6', '<p>案例22、10月25日，当日12时20分左右，某小区8号楼2楼一处商住房发生火灾。这个房间被附近一个工地租下来,临时当做农民工的宿舍，里面住了40多名农民工。火是从二楼着起来的。附近的邻居一边报警，一边急忙跑到工地报信。“汪、汪、…”人群中传来两声狗叫，只见一个头戴安全帽的工人紧紧地抱着一条狗，坐在一堆刚刚抢出来的被子上。据这位工人介绍，着火时，他刚刚走出宿舍，当时屋内火苗已经蹿起老高，不知道里面什么样。情急之下，他拎起一桶水冲进屋内，看见他们养来看家的小狗仍坚守在“岗位”上，他急忙将清水浇到蹿起的火苗上，抱起小狗和行李跑出火海。当他准备再次进屋抢救财产时，火势越来越大，已经无法靠近。大火被扑灭。一名工人说，屋内没有其他火源和电源。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45940', '1', '<p>1、临时宿舍等生活设施，距离小量易燃品贮藏室的间距不小于（&nbsp;）m。</p>', '', '45939', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45941', '1', '<p>2、临时宿舍距离火灾危险性大的生产场所间距不得小于（&nbsp;）m。</p>', '', '45939', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45942', '2', '<p>3、下列关于施工现场防火时，作业棚和临时生活设施的叙述正确的是（&nbsp;）。</p>', '', '45939', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45943', '3', '<p>4、宿舍有人吸烟，点燃易燃物后，引起火灾。</p>', '', '45939', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45949', '6', '<p>案例23、某省建公司在公路局宿舍工程中，安装的龙门架全高20m。9月1日安装到15m高度，临时缆风绳共4根锚在10m高处。9月3日由副班长×××带领4人和部分民工继续安装，先将缆风绳由10m高处移至15m处锚固。9时30分安装到20m高时，突遇一阵强东风。龙门架晃动数次后，将东南方向的缆风绳拉断，龙门架向西倾倒。在高空作业的4人随同龙门架坠落地。副班长×××等3人死亡，1人紧抱在主柱上，造成重伤。后查缆风绳锚固点的水平角度不符合要求，且东南角方向的缆风绳在离锚固点2m处，原已磨断2／3仍继续使用，其他缆风绳也没有收紧。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45950', '1', '<p>1、用作缆风绳的钢丝绳安全系数为（&nbsp;）。</p>', '', '45949', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45951', '1', '<p>2、在施工现场，应标出龙门架的组对位置、工件就位时龙门架所到达的位置以及行走路线的刻度，以监测龙门架两侧移动的同步性 ，要求误差小于跨度的（&nbsp;）。</p>', '', '45949', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45952', '2', '<p>3、移动式龙门桅杆吊装，施工人员进入施工岗位吊装前必须做好(&nbsp;&nbsp;)。</p>', '', '45949', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45953', '3', '<p>4、龙门架倒塌是遇风时由于其他缆风绳也没有收紧，故全部风载荷由磨断2／3的钢丝绳负担被拉断而导致。</p>', '', '45949', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45959', '6', '<p>案例24、王师傅已有三年多推土机操作经验，近期他参加正处于施工紧张阶段的挖土筑路工程，当晚，项目部施工技术人员及工程队长向施工人员进行技术交底，并提出提前完工的要求。第二天一早，王师傅对推土机进行班前保养及例行检查，在观察推土机周围无障碍物，确定安全后，启动机械，进行施工作业。时值盛夏、天气炎热，项目部准备了防暑饮料、派人送到机前，为抓紧时问赶任务，王师傅一边推一边接过饮料自饮。工程地带有一段坡道，下坡时，他空档滑行，为企业节省了很多油料。当他发现有一台推土机因故无法启动时，主动过去用推土机顶推帮助启动。作业中，他感觉机械底盘有异响，就将推土机停到地势较高的坡道上，然后王师傅熄火下机钻进底盘下检查，突然推土机向下坡方向自行滑移，王师傅未及脱身，惨遭不幸。</p>', '', '0', '13', 'B类（项目负责人）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45960', '1', '<p>1、分析事故原因有以下几种,①作业前对推土机进行班前保养及例行检查②推土机作业时上下人，传递物件③下坡时，空档滑行④推土机起动时用其他机械推顶启动⑤坡道上停机，未落下铲刀，变速杆未挂低速档，未接合主离合器，未锁住制动踏板．履带未楔住.其中正确的有（&nbsp;）。</p>', '', '45959', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('45961', '1', '<p>2、两台以上推土机在同一地区作业时，前后距离应大于8m，左右距离应大于（&nbsp;）。</p>', '', '45959', null, null, '1', '0', '0');
