INSERT INTO `sw_question` VALUES ('46143', '6', '<p>案例2、某工程公司在一大厦广场基础工程进行护坡桩锚杆作业。当天工地主要负责人、安全员、电工等有关人员不在现场。下锚杆筋笼时，班组长因故请假也不在现场，13名民工在无人指挥的情况下自行作业，因钢筋笼将配电箱引出的380V电缆线磨破，使钢筋笼带电，造成5人触电死亡。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
