INSERT INTO `sw_question` VALUES ('46148', '6', '<p>案例3、某公司在一工地用吊篮进行外装修作业时，施工员指派一名抹灰工升吊篮，由于吊篮未挂保险钢丝绳，在上升时突然一个倒链急剧下滑，吊篮随即倾斜，由于一作业人员未系安全带，从吊篮坠落死亡。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
