INSERT INTO `sw_question` VALUES ('46153', '6', '<p>案例4、某工地按施工进度要求正在搭设扣件式脚手架，安全员巡视检查发现新购进的扣件表面粗糙，商标模糊，向架子工询问，工人说有的扣件螺栓滑丝，有的扣件一拧，小盖口就裂了。安全员对此批扣件质量发生怀疑。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
