INSERT INTO `sw_question` VALUES ('46163', '6', '<p>案例6、某建筑公司，为了安排下岗职工就业，在集镇路边30m&lt;sup&gt;2&lt;/sup&gt;房间内，开了一个电气焊修理门市部。为了节约资金，焊机用的是已停用一年的旧机，一次测电源用的是闸刀开关，并安装在室内，门口路边就是焊接与切割场所。室内既是焊切工具、氧气瓶、乙炔瓶的储存间，又是工人中午吃饭休息的场所。公司对工人只进行了短期培训，便开始作业。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
