INSERT INTO `sw_question` VALUES ('46168', '6', '<p>案例7、大地公司在东征县小李乡进行一项建筑工程建设。已于2004年2月1日领取安全许可证。但因故不能施工，故需向有关部门申请延期。请回答大地公司董事长向您咨询的几个问题。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
