INSERT INTO `sw_question` VALUES ('46173', '6', '<p>案例8、原南第二建筑公司是原南友谊酒店扩建项目的总承包商，大政公司、大发公司是部分工程的分包商。原南第二建筑公司的董事长是张三，负责该项目的项目经理叫李四，王五是原南第二建筑公司的安全生产部门经理。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
