INSERT INTO `sw_question` VALUES ('46178', '6', '<p>案例9、太平建筑公司承建黄平市友好饭店的扩建项目，部分工程分包给黄平二建、黄平三建，整个项目由亚冬监理公司监理。太平建筑公司董事长对生产安全事故的应急救援和调查处理提出以下问题，请回答：</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46179', '1', '<p>1、若黄平二建负责部分的工程在施工中发生生产安全事故，应由（&nbsp;）负责上报事故。</p>', '', '46178', null, null, '1', '0', '0');
