INSERT INTO `sw_question` VALUES ('46183', '6', '<p>案例10、肥东市白云饭店为提高饭店档次，经单位负责人决定对饭店进行装修，工程由肥东三建负责施工。此次装修将涉及承重结构的变动。请就此案例回答下列问题：</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
