INSERT INTO `sw_question` VALUES ('46185', '1', '<p>2、装修过程中原租用白云饭店15层写字间的宏富贸易公司可否按自己的需要自行变动房屋的承重结构的说法正确的是（ ）。</p>', '', '46183', null, null, '1', '0', '0');
