INSERT INTO `sw_question` VALUES ('46189', '1', '<p>1、若元广建设集团是中央管理的建筑施工企业，则它的安全生产许可证的颁发和管理由（&nbsp;）负责。</p>', '', '46188', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46190', '1', '<p>2、元广建设集团向安全生产许可证颁发管理机关申请领取安全生产许可证，安全生产许可证颁发管理机关应当自收到申请之日起（&nbsp;）日内审查完毕。</p>', '', '46188', null, null, '1', '0', '0');
