INSERT INTO `sw_question` VALUES ('46195', '1', '<p>2、在挡土墙中，构造简单、施工方便、便于就地取材，而且主要是靠自身的重力来抵抗倾覆的挡土墙是（&nbsp;）。</p>', '', '46193', null, null, '1', '0', '0');
