INSERT INTO `sw_question` VALUES ('46197', '3', '<p>4、确定挡土墙基础埋深的影响因素较多，相对于土质地基，岩石地基的挡土墙埋置深度应更大。</p>', '', '46193', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46198', '6', '<p>案例13、一住宅小区施工现场，钢筋工王某正在使用钢筋切断机切割钢筋，由于切刀附近有些钢筋的断头，王某考虑到开关箱还有一些距离（约4m），为节省时间，王某直接用手去清理，结果导致4只手指被截断。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46199', '1', '<p>1、切断短料时，手和切刀之间的距离应保持在（&nbsp;）以上，如手握端小于400mm时，应采用套管或夹具将钢筋短头压住或夹牢。</p>', '', '46198', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46200', '1', '<p>2、钢筋切断机的接送料工作台面与切刀下部应（&nbsp;）。</p>', '', '46198', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46201', '2', '<p>3、施工现场常用的钢筋加工机械有（&nbsp;）等。</p>', '', '46198', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46202', '3', '<p>4、钢筋切断机在运转过程中，严禁用手直接清除切刀附近的断头和杂物。</p>', '', '46198', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46203', '6', '<p>案例14、9月10日上午，一小区工程9号楼工地使用的QTG40塔吊在将距塔基有10m远的路边一堆重约2.7吨的钢筋，吊到距塔基25m远的钢筋堆场时，途中发生塔吊塔身下端断裂，造成塔吊被毁，驾驶室严重变形，吊机司机经抢救无效死亡。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46204', '1', '<p>1、塔机最重要的安全装置是（&nbsp;），它应始终处于正常工作状态。</p>', '', '46203', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46205', '1', '<p>2、臂架根部铰点高度大于（&nbsp;）的塔机，应安装风速仪，当风速大于工作极限风速时，应能发出停止作业的警报。</p>', '', '46203', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46206', '2', '<p>3、塔机最基本的工作机构是（&nbsp;）。</p>', '', '46203', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46207', '3', '<p>4、QTG40塔机是一种汽车式塔式起重机。</p>', '', '46203', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46208', '6', '<p>案例15、24日上午8时许，某音乐厅项目开始屋面混凝土浇捣施工作业。25日5时10分左右，屋面浇捣施工作业即将完成时，在无任何预兆情况下，屋面突然坍塌，现场作业的24人随屋面混凝土、钢筋、模板坠落，其中4人经抢救无效死亡，20人受伤。经调查，导致这起事故的直接原因是搭设支模架的钢管、扣件质量不合格；支模架搭设不规范，立杆步距大小不一，立杆间距过大，竖向剪刀撑数量极少，水平剪刀撑未设等。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46209', '1', '<p>1、剪刀撑斜杆与地面的夹角应在（&nbsp;）之间。</p>', '', '46208', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46210', '1', '<p>2、支架立杆必须设置纵、横向扫地杆，纵向扫地杆的设置应（&nbsp;）。</p>', '', '46208', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46211', '2', '<p>3、下列有关扣件式钢管支架的说法，正确的是（&nbsp;）。</p>', '', '46208', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46212', '3', '<p>4、立杆步距、间距、剪刀撑应根据经批准的施工方案设置。</p>', '', '46208', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46213', '6', '<p>案例16、9月28日上午，某公司新建厂区进入涂料粉刷工序。油漆工胡某用2.5m高移动式操作平台，在成品仓库二楼2-3轴线，F-G位置屋面的次梁天棚刮腻子时，因操作平台无围护栏杆，胡某后退操作踩空坠落，经送医院抢救无效死亡。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46214', '1', '<p>1、高处作业可分为四级，高度在5~15m时，应为（&nbsp;）高处作业。</p>', '', '46213', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46215', '1', '<p>2、操作平台的面积和高度应满足（ ）要求。</p>', '', '46213', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46216', '2', '<p>3、以下有关搭设临边防护栏杆的要求，正确的是（&nbsp;）。</p>', '', '46213', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46217', '3', '<p>4、本起事故的直接原因是移动式操作平台无围护栏杆。</p>', '', '46213', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46218', '6', '<p>案例17、在某工地的上部距地面7m左右处，有一条10kV排挤线路经东西方向穿过。5月17日开始土方回填，至5月底完成土方回填时，排挤线路间隔地面净空只剩5.6m，期间施工单位曾多次要求建设单位尽快迁移，但始终未得以解决，而施工单位就一直违章在高压排挤线下方不采取任何措施冒险作业。当8月3日承包人温某正违章指挥12名民工，将6m长的钢筋笼放进桩孔时，由于顶部钢筋距高压线过近而产生电弧，11名民工被击倒在地，造成3人死亡，3人受伤事故。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46219', '1', '<p>1、在建工程（含脚手架）周边与10kV外电架空线路的边线之间的最小安全操作距离为（&nbsp;）。</p>', '', '46218', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46220', '1', '<p>2、对外电线路防护应做到坚固稳定，能防止直径为（&nbsp;）的固体异物穿越，并须在防护隔离处悬挂醒目的警告标志牌。</p>', '', '46218', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46221', '2', '<p>3、对外电线路防护的基本措施可以是（&nbsp;）。</p>', '', '46218', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46222', '3', '<p>4、由于高压线路的四周空间存在强电场，导致四周的导体成为带电体，因此规范规定在高压排挤线路下方作业应保持一定的安全间隔，防止发生触电事故。</p>', '', '46218', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46223', '6', '<p>案例18、某医院工程北配楼正在进行装修施工，电焊工张某在地上一层焊接水暖支架时，焊渣跌落至地下一层，引燃了堆放在地下一层的聚苯乙烯保温材料，从而引发大火。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46224', '1', '<p>1、我国消防工作的方针是（&nbsp;）。</p>', '', '46223', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46225', '1', '<p>2、施工现场内贮存易燃易爆危险品的仓库、库区，属于（&nbsp;）动火区域。</p>', '', '46223', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46226', '2', '<p>3、在施工现场禁火区域内动火，作业前必须申请办理动火证，动火证必须注明（&nbsp;）。</p>', '', '46223', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46227', '3', '<p>4、电焊工张某违规操作是引起本起事故的主要原因。</p>', '', '46223', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46228', '6', '<p>案例19、某冷库内装修工地，照明用碘钨灯直接用木棍连接放在装修好的墙边，夜里无人施工，碘钨灯烤着墙边的装修材料，引起大火，损失40余万元。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46229', '1', '<p>1、聚光灯及碘钨灯等高热灯具与易燃易爆物的防护距离不宜小于（&nbsp;），且不得直接照射易燃物。</p>', '', '46228', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46230', '1', '<p>2、施工现场必须设立消防车通道，其宽度应不小于（&nbsp;）。</p>', '', '46228', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46231', '2', '<p>3、施工现场要明确划分出（&nbsp;），各区域之间一定要有可靠的防火间距。</p>', '', '46228', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46232', '3', '<p>4、物质的闪点越低，发生起火的危险性就越大。</p>', '', '46228', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46233', '6', '<p>案例20、某建筑公司购置1台由某塔机生产厂生产的QTC25A塔式起重机，该塔机厂雇用李某进行首次安装。按照塔机安装的程序，塔身、塔帽、配重臂安装完毕后，着手安装起重臂(该塔机是自装式水平臂塔机)。起重臂在安装时对吊点位置、吊索的拴系方式、重心所处位置均有严格的技术要求。按照要求应设置六倍率吊索。李某等人设置了2个吊点，使用4根钢丝绳，在吊索未拴牢的情况下，将起重臂拉起，在安装拉杆时，吊点处的钢丝绳在冲击力的作用下，将起重臂两根侧向斜腹杆拉断后，向起重臂根部水平方向移动约450mm。起重臂瞬间下沉，造成钢丝绳断裂，起重臂以铰接点为轴心坠落，在起重臂上的五名操作工人随之坠落，造成4人死亡，1人受伤。经事故调查，该塔机无技术图纸，无生产工艺，无产品检验报告，作业人员未系安全带，无证作业。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46234', '1', '<p>1、塔式起重机的主参数为（&nbsp;）。</p>', '', '46233', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46235', '1', '<p>2、下列不属于塔式起重机金属结构的部分为（&nbsp;）。</p>', '', '46233', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46236', '2', '<p>3、塔式起重机按变幅方式分可分为（&nbsp;）。</p>', '', '46233', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46237', '3', '<p>4、该塔机生产厂违法雇用无安装资质的安装单位。</p>', '', '46233', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46238', '6', '<p>案例21、某公寓楼工程发生了一起施工升降机吊笼冒顶坠落事故，造成吊笼内的3名员工死亡。该工程由裙体相连的A.B.C三幢32层高层公寓楼组成，施工总承包单位某建筑公司将该工程的部分装饰工程分包给某装饰公司。事故发生时，工程外墙装修即将结束，内装修进入修补阶段。A楼的施工升降机已拆卸至1 3层高度。发生事故的施工升降机位于A楼，由某设备租赁公司提供并负责日常维修检查工作，总承包单位工程项目部使用并配备了电梯司机。事故发生当日6时20分左右，某装饰公司员工鲍某等3人在电梯司机尚未上班到岗的情况下，擅自驾乘A楼施工升降机右笼前往7层，在上升过程中，由于超高极限开关未起作用，上行停车操作失控，发生吊笼冒顶，酿成事故。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46239', '1', '<p>1、施工升降机提升吊笼的钢丝绳的安全系数不得小于（&nbsp;）。</p>', '', '46238', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46240', '1', '<p>2、施工升降机提升吊笼的钢丝绳的直径不得小于（&nbsp;）mm。</p>', '', '46238', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46241', '2', '<p>3、下列属于施工升降机的安全保护装置的是（&nbsp;）。</p>', '', '46238', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46242', '3', '<p>4、鲍某等3人非电梯司机，无证且擅自操作施工升降机，对事故应负直接责任。</p>', '', '46238', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46243', '6', '<p>案例22、一高层住宅工程，正在装修，外脚手架已经拆到了五层楼板处，三个班组的分工为一组贴面砖，二组负责剪断脚手架的连墙件，三组拆除脚手架，当五层面砖刚完成一半时，二组已经将15m高的脚手架连墙件全部拆除，当一组拟转移到下层作业时，脚手架向外倒塌，架上人员全部坠落。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46244', '1', '<p>1、扣件式脚手架规范规定，每根钢管的重量不应超过（&nbsp;）kg。</p>', '', '46243', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46245', '1', '<p>2、当脚手架的扣件夹紧钢管时，开口处的最小距离应不小于（&nbsp;）mm。</p>', '', '46243', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46246', '2', '<p>3、下列属于扣件式脚手架上的永久荷载的是（&nbsp;）。</p>', '', '46243', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46247', '3', '<p>4、拆除脚手架前，没有编制拆除方案，只在现场临时作了分工。</p>', '', '46243', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46248', '6', '<p>案例23、某施工工地，早晨上班，土建队的木工班继续拆除热电厂蒸发站工程7m高的混凝土平台模板，当一名工人从4—5轴线中间的钢窗进入操作地点时，他左手攀着钢窗开窗器立管跃入室内，突然喊了两声“电着我了”。该班长立即跑去找电工切断电源线，但因电源来自安装队使用的卷扬机上的电源线，土建队电工不清楚，直到7、8分钟后，才切断电源，触电工人经抢救无效死亡。经查拆除的模板钢支架由4．8m处落下，一端砸断了卷扬机的电源线，另一端倒在拆下的钢管上，钢管又搭在钢窗上。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46249', '1', '<p>1、配电柜正面的操作通道宽度，双列面对面布置时不应小于（&nbsp;）m。</p>', '', '46248', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46250', '1', '<p>2、配电柜正面的操作通道宽度，单列布置或双列背对背布置时不应小于（&nbsp;）m。</p>', '', '46248', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46251', '2', '<p>3、配电室的位置应符合（&nbsp;）的原则。</p>', '', '46248', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46252', '3', '<p>4、事故的直接原因是卷扬机电源线被轧断后，又与钢管和钢窗相连，使钢窗带电，二人手扶钢窗触电死亡。</p>', '', '46248', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46253', '6', '<p>案例24、有一项工程设置了一道重力式挡土墙，该地土质松软，挡土墙基础埋深0．5m，墙后有一道山坡，施工过程中，挡土墙倒塌，引起土方边坡的坍塌。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46254', '1', '<p>1、重力式挡土墙一般是使用在开挖深度为（&nbsp;）之内.</p>', '', '46253', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46255', '1', '<p>2、土石根据其坚硬程度和开挖方法及使用工具可分为 （&nbsp;）类。</p>', '', '46253', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46256', '2', '<p>3、挡土墙基础埋置深度，应根据地基土的（&nbsp;）等来确定。</p>', '', '46253', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46257', '3', '<p>4、事故原因之一是挡土墙埋置过深。</p>', '', '46253', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46258', '6', '<p>案例25、某地一大酿酒厂要建一小型污水处理厂，需开挖1.5m深的基坑，无降水措施，放坡不大，无支护，两名工人加夜班挖剩余部分土，土质为回填土。离基坑1m外有原排污下水道，下水道向外渗水，夜里正当工人挖土时，原污水管突然爆裂，水冲泥土造成塌方。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46259', '1', '<p>1、人工开挖土方时，两人的操作间距应保持（&nbsp;）。</p>', '', '46258', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46260', '1', '<p>2、符合（&nbsp;）情况属于三级基坑。</p>', '', '46258', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46261', '2', '<p>3、挖土时应遵守（&nbsp;）规定。</p>', '', '46258', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46262', '3', '<p>4、事故原因之一无支护及降水措施。</p>', '', '46258', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46263', '6', '<p>案例26、某工程因抢进度，提前拆除模板。该楼四层楼板在制定拆除方案时，未考虑安全措施，也未经审批。在接近拆完时，突然一大片混凝土楼板掉落，4名拆模工人压在下边，经抢救无效死亡。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46264', '1', '<p>1、楼板跨度在8m以上时，底模拆除时混凝土强度应达到设计强度的（ ）。</p>', '', '46263', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46265', '1', '<p>2、模板拆除时，拆下的构配件严禁（&nbsp;）。</p>', '', '46263', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46266', '2', '<p>3、梁、板结构模板拆除应遵守（&nbsp;）规定。</p>', '', '46263', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46267', '3', '<p>4、因抢进度提前拆除模板无需审批。</p>', '', '46263', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46268', '6', '<p>案例27、某工地工人在拆现浇楼板钢模时，审批手续还未办好，由于面积大，一时拆不完，中午吃饭时，工人吴某从未拆完的钢模板下经过，突然上边已活动的几块钢模板掉了下来，刚好击中吴某头部，经抢救无效死亡。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46269', '1', '<p>1、楼板模板及其支架(楼层高度4m以下)定型组合钢模板自重标准值为（ ）。</p>', '', '46268', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46270', '1', '<p>2、模板结构中钢支架立柱及桁架杆件的受压构件长细比不应大于（&nbsp;）。</p>', '', '46268', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46271', '2', '<p>3、一般模板的组成部分为（&nbsp;）。</p>', '', '46268', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46272', '3', '<p>4、事故原因之一是模板未按规定连续拆除，而中途停歇。</p>', '', '46268', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46273', '6', '<p>案例28、【背景材料】某工程安全检查结果如下:（1）安全管理：保证项目得45分，一般项目得35分；（2）文明施工：保证项目得46分，一般项目得34分；（3）脚手架：保证项目得42分，一般项目得36分；(4)模板支架：保证项目得50分，一般项目得35分；(5)“三宝”“四口”防护：扣18分；（6）施工用电：保证项目得38分，一般项目得36分；（7）物料提升机：保证项目小计42分，一般项目得36分；（8）施工机具：得82分；（9）“基坑支护、土方作业”：得85分；现场无塔吊、起重吊装。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46274', '1', '<p>1、文明施工分项在汇总表中得分为（&nbsp;）。</p>', '', '46273', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46275', '1', '<p>2、施工用电分项在汇总表中得分为（&nbsp;）。</p>', '', '46273', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46276', '2', '<p>3、安全管理检查评分表中，属于保证项目的有（&nbsp;）。</p>', '', '46273', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46277', '3', '<p>4、汇总表总计得分是72.1分，大于70分，该工程的安全检查评定等级为合格。</p>', '', '46273', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46278', '6', '<p>案例29、【背景材料】某年3月3日下午，某大桥建设工地，正在起吊重物的汽车式起重机发生侧翻，造成3名司索人员落水，其中1人获救，2人死亡。3月3日下午，大桥建设工地现场负责人程某某安排带班人员李某某、汽车式起重机操作员孙某某等人在桥梁合笼处进行吊装作业。16时许，孙某某在李某某的指挥下驾驶一台汽车式起重机将桥底的8片贝雷架起吊至一定位置停下，三名司索人员刘某某、何某某、颜某某在未穿戴救生衣、保险带等防护用品的情况下站在悬空（与水面距离约5米）的贝雷架上进行司索作业。停顿保持了约一分钟，汽车式起重机发生侧翻，贝雷架连同三人一起掉入水中。刘某某会游泳，浮出水面，被人救起，何某某、颜某某沉入水中。何某某在20分钟后被找到，急送当地人民医院抢救，因溺水时间过长，抢救无效死亡。当晚21时许，颜某某的尸体被打捞上岸。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46279', '1', '<p>1、下列属于起重吊装作业重大危险源的是（&nbsp;）。</p>', '', '46278', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46280', '1', '<p>2、事故发生后，应迅速辩别事故的类别、性质、危害程度，适时启动相应的应急救援预案，（&nbsp;）是应急救援的首要任务。</p>', '', '46278', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46281', '2', '<p>3、引起此事故的间接原因有（&nbsp;）。</p>', '', '46278', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46282', '3', '<p>4、起重伤害是指从事各种起重作业时发生的机械伤害事故，包括起重设备引起的触电及检修时制动失灵造成的伤害,不包括上下驾驶室时发生的坠落伤害。</p>', '', '46278', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46283', '6', '<p>案例30、【背景材料】某年9月9日下午16时15分左右，某工地在塔吊塔基开挖时，发生泥浆池坍塌事故，造成7人死亡，3人受伤。直接经济损失315万元。9月9日下午3时左右，2号塔吊基坑全部开挖到基底设计标高后，项目部经理徐某某在坑底现场指挥，安排王某某等9名操作工人进入基坑开始桩头清理、支模等工作。据受伤人员王某某事后介绍，4时15分左右，在基坑作业的王某某曾听到有人喊“啊唷，塌方”，同时，他看到塔吊基坑北侧土体开始坍塌，王赶忙扔掉手上铁锹，马上往南边爬；当爬到塔吊基坑边坡上部时，看到泥浆水往下流动，池内泥浆随之倾泻而下，很快就将塔吊基坑淹没。在基坑内的徐某某因拼命向南边逃跑，腿部被泥浆淹埋，茹某某因抓住架子，被泥浆淹埋到胸部。事故造成徐某某、王某某、茹某某3人受伤，另7名工人被埋。事故发生后；当地有关部门接到报案后，立刻启动了应急救援预案实施抢救，市委、市政府领导亲临现场指导搜救。经过努力，至10日上午，7名被埋人员陆续在事故现场找到，经确认均已死亡。</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46284', '1', '<p>1、下列属于基坑支护作业重大危险源的是（&nbsp;）。</p>', '', '46283', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46285', '1', '<p>2、下列（&nbsp;）不是坍塌事故应急救援应坚持的原则。</p>', '', '46283', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46286', '2', '<p>3、造成此事故的直接原因有（&nbsp;）。</p>', '', '46283', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46287', '3', '<p>4、坍塌事故发生后，应迅速安排专人及时切断有关电闸，并立即组织抢险人员尽快到达事故现场。</p>', '', '46283', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46288', '6', '<p>案例31、【背景材料】某年5月21日上午10时许，某建筑工地发生一起机械伤害事故，造成一名工人死亡，直接经济损失30万元。5月20日，项目部施工员曾某某打电话给甘肃人赵某某，告知生活区路面损坏，需要浇捣混凝土，口头约定工资600元。5月21日上午，赵某某带冯某某等5人到工地，在曾某某口头交底下，8时开始搅拌混凝土，赵某某操作搅拌机，冯某某在后斗入料。料斗提升是依靠电动机带动轮盘上的钢丝做圆弧运动。10时许，搅拌第12包水泥时，料斗提升过程中，因连接料斗钢丝绳上的马鞍扣松懈，致使钢丝绳滑出，料斗在重力作用下坠落，砸中在料斗下搬运水泥的冯某某，头部被砸压在料斗下，赵某某当即想法抢救，在场的人用钢管撬和人力提拉料斗，由于配料过重未能提升起料斗，随后调用塔吊吊起料斗，将伤者抬出后立即送往当地中医院救治，经抢救无效死亡</p>', '', '0', '14', 'C类（专职安全管理员）', '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46289', '1', '<p>1、在拌和作业中，离合器、制动器、钢丝绳达不到要求，可能导致发生机械伤害事故，应采取（&nbsp;）控制措施。</p>', '', '46288', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46290', '1', '<p>2、在《施工机具检查评分表》中，离合器、制动器、钢丝绳达不到要求每项扣（&nbsp;）分。</p>', '', '46288', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46291', '2', '<p>3、造成此事故的直接原因有（&nbsp;）。</p>', '', '46288', null, null, '1', '0', '0');
INSERT INTO `sw_question` VALUES ('46292', '3', '<p>4、机械伤害是指被机械设备或工具绞、碾、碰、割、戳等造成的人身伤害，不包括车辆、起重设备引起的伤害。</p>', '', '46288', null, null, '1', '0', '0');
